import React from 'react';
import { postArray } from '../Array.jsx'

export const Article0 = () => {
    return (
        <h2 className="article-title" style={{'margin-top':200}}>{postArray[0].articleTitle}</h2>
    )
}

export const Article1 = () => {
    return (
        <h2 className="article-title" style={{'margin-top':200}}>{postArray[1].articleTitle}</h2>
    )
}
